function App() {
  return (
    <div className="wrapper p-5">
      <Container>
        <Row className='justify-content-center p-5'>
          <Col className=''>
            <Card>
            <h3>React Django</h3>
            <AddToDo />
            <ToDo />
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
